import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import {Link} from 'react-router-dom';
import './App.css';
import Routes from './routes';

class App extends Component {
  render() {
    return (
      <Container fluid>
      <Row>
      <Col>
      <div className="App-header">
        <header>
          <a><Link to="/"><button class="but">Home</button></Link></a>
          <a><Link to="/admin"><button class="but">Admin</button></Link></a>
        </header>
        
      </div>
      </Col>
      </Row>
      <Row>
      <div className="App">
      <Routes />
      </div>
      </Row>
      </Container>
      
      
    );
  }
}

export default App;
